
const canvas = document.getElementById('canvas1');
const ctx = canvas.getContext('2d');
canvas.width = 800;
canvas.height = 450;

const image1 = new Image();
/* image1.src = "image1.jpg";  Diretorio da imagem usada e convertida para base64(convertor online) */
image1.src = "data:image/jpeg;base64,"; /* Diretorio da imagem usada */
image1.addEventListener('load', function(){ /* sem esse evento a imagem não aparece */
    ctx.drawImage(image1, 0, 0, canvas.width, canvas.height); /* apos o evento de load, carregar a imagem */
    const scannedImage = ctx.getImageData(0,0, canvas.width, canvas.height);
    console.log(scannedImage);/* imprime no console o rgb de cada pixel */

    /* tornando a imagem em grayscale(https://en.wikipedia.org/wiki/Grayscale) */
    const scannedData = scannedImage.data;
    for(let i =  0; i < scannedData.length; i += 4){
        const total = scannedData[i] + scannedData[i+1] + scannedData[i+2];
        const averageColorValue = total/3;
        scannedData[i] = averageColorValue + document.getElementById('red').value;   /*  vermelho   R*/ 
        scannedData[i+1] = averageColorValue + document.getElementById('green').value; /*    verde    G*/
        scannedData[i+2] = averageColorValue + document.getElementById('blue').value; /*     azul    B*/
    }
    scannedImage.data = scannedData;
    ctx.putImageData(scannedImage,0,0);

    function myColor(){
        var red = document.getElementById('red').value;
        var green = document.getElementById('green').value;
        var blue = document.getElementById('blue').value;
        var color = 'rgb('+ red + ',' + green + ',' + blue + ')';
        document.body.style.backgroundColor = color; /*Muda cor do background de acordo com o rgb*/
        document.getElementById('box').value = color;
    }
    
    document.getElementById('red').addEventListener('input', myColor);
    document.getElementById('green').addEventListener('input', myColor);
    document.getElementById('blue').addEventListener('input', myColor);
})